import { StreamingTrack } from '../types/track';

export interface SunoWebhookEvent {
  taskId: string;
  status: 'generating' | 'completed' | 'failed';
  audioUrl?: string;
  error?: string;
  metadata?: {
    title?: string;
    duration?: number;
    genre?: string;
    mood?: string;
  };
}

export interface WebhookHandler {
  onTrackGenerating: (taskId: string) => void;
  onTrackCompleted: (taskId: string, track: StreamingTrack) => void;
  onTrackFailed: (taskId: string, error: string) => void;
}

class WebhookService {
  private handlers: Map<string, WebhookHandler> = new Map();
  private pendingTracks: Map<string, { status: 'generating'; startTime: number }> = new Map();
  private webhookUrl: string;

  constructor() {
    this.webhookUrl = process.env.REACT_APP_WEBHOOK_URL || 'https://webhook.site/your-unique-url';
    this.initializeWebhook();
  }

  private initializeWebhook() {
    console.log('üîó Webhook service initialized with URL:', this.webhookUrl);

    // Don't automatically simulate events - wait for handlers to be registered
    console.log('üîó Webhook service ready - will simulate events when handlers are registered');
  }

  public registerHandler(taskId: string, handler: WebhookHandler): void {
    this.handlers.set(taskId, handler);
    this.pendingTracks.set(taskId, { status: 'generating', startTime: Date.now() });

    // Notify that generation has started
    handler.onTrackGenerating(taskId);

    console.log(`üîó Registered webhook handler for task: ${taskId}`);

    // If this is the first handler, start simulating webhook events
    if (this.handlers.size === 1) {
      console.log('üîó First handler registered, starting webhook simulation...');
      this.simulateWebhookEvents();
    }
  }

  public unregisterHandler(taskId: string): void {
    this.handlers.delete(taskId);
    this.pendingTracks.delete(taskId);
    console.log(`üîó Unregistered webhook handler for task: ${taskId}`);
  }

  public processWebhookEvent(event: SunoWebhookEvent): void {
    const handler = this.handlers.get(event.taskId);
    if (!handler) {
      // Only log warning for non-test events to reduce noise
      if (!event.taskId.startsWith('test_task_')) {
        console.warn(`üîó No handler found for webhook event: ${event.taskId}`);
      }
      return;
    }

    switch (event.status) {
      case 'completed':
        if (event.audioUrl) {
          const track: StreamingTrack = {
            id: `suno_${event.taskId}`,
            title: event.metadata?.title || `AI Generated Track ${event.taskId}`,
            artist: 'AI-generated track via Suno API',
            duration: event.metadata?.duration || 150,
            audioUrl: event.audioUrl,
            category: 'gaming', // Default category
            subcategory: 'ambient', // Default subcategory
            mood: (event.metadata?.mood as any) || 'chill',
            energy: 3, // Default medium energy
            tags: ['ai-generated', 'custom', event.metadata?.genre || 'electronic'],
            streamSafe: true,
            loopFriendly: true,
            hasIntro: false,
            hasOutro: false,
            uploadDate: new Date().toISOString(),
            uploadedBy: 'system',
            approved: true,
            // Legacy fields for backward compatibility
            sunoId: event.taskId,
            streamingCategory: 'chill_gaming',
            energyLevel: 'medium',
            genre: (event.metadata?.genre as any) || 'electronic',
            dmcaSafe: true,
            vodSafe: true,
            license: 'royalty_free',
            licenseDetails: 'Suno AI generated track',
            platformCompliance: {
              twitch: 'safe',
              youtube: 'safe',
              facebook: 'safe',
              tiktok: 'safe'
            },
            usageTracking: {
              usageCount: 0,
              lastUsed: undefined
            },
            agencyNotes: 'AI-generated track via webhook'
          };

          handler.onTrackCompleted(event.taskId, track);
          this.pendingTracks.delete(event.taskId);
          this.handlers.delete(event.taskId);

          console.log(`üéµ Track completed: ${event.taskId}`, track);
        }
        break;

      case 'failed':
        handler.onTrackFailed(event.taskId, event.error || 'Unknown error');
        this.pendingTracks.delete(event.taskId);
        this.handlers.delete(event.taskId);

        console.error(`‚ùå Track generation failed: ${event.taskId}`, event.error);
        break;

      case 'generating':
        handler.onTrackGenerating(event.taskId);
        console.log(`üîÑ Track still generating: ${event.taskId}`);
        break;
    }
  }

  public getPendingTracks(): Map<string, { status: 'generating'; startTime: number }> {
    return new Map(this.pendingTracks);
  }

  public isTrackGenerating(taskId: string): boolean {
    return this.pendingTracks.has(taskId);
  }

  public getGenerationTime(taskId: string): number | null {
    const track = this.pendingTracks.get(taskId);
    if (track) {
      return Date.now() - track.startTime;
    }
    return null;
  }

  // Manually trigger webhook simulation for testing
  public triggerTestWebhooks(): void {
    if (this.handlers.size === 0) {
      console.log('üîó No handlers registered, creating test handlers first...');

      // Create test handlers for demonstration
      const testHandler: WebhookHandler = {
        onTrackGenerating: (taskId) => console.log(`üîÑ Test track generating: ${taskId}`),
        onTrackCompleted: (taskId, track) => {
          console.log(`‚úÖ Test track completed: ${taskId}`, track);
          // Save to storage for demonstration
          const trackStorageService = require('./trackStorageService').default;
          trackStorageService.saveTrack(track);
        },
        onTrackFailed: (taskId, error) => console.error(`‚ùå Test track failed: ${taskId}`, error)
      };

      this.registerHandler('test_task_1', testHandler);
      this.registerHandler('test_task_2', testHandler);
    } else {
      console.log('üîó Triggering test webhooks for existing handlers...');
      this.simulateWebhookEvents();
    }
  }

  private simulateWebhookEvents(): void {
    // Only simulate events if there are registered handlers
    if (this.handlers.size === 0) {
      console.log('üîó No webhook handlers registered, skipping test events');
      return;
    }

    // Simulate a track completing after 5 seconds
    setTimeout(() => {
      // Only process if we still have handlers
      if (this.handlers.size > 0) {
        const testEvent: SunoWebhookEvent = {
          taskId: 'test_task_1',
          status: 'completed',
          audioUrl: 'https://api.sunoapi.org/sample1.mp3',
          metadata: {
            title: 'Test AI Track',
            duration: 180,
            genre: 'ambient',
            mood: 'chill'
        }
        };
        this.processWebhookEvent(testEvent);
      }
    }, 5000);

    // Simulate another track completing after 8 seconds
    setTimeout(() => {
      // Only process if we still have handlers
      if (this.handlers.size > 0) {
        const testEvent2: SunoWebhookEvent = {
          taskId: 'test_task_2',
          status: 'completed',
          audioUrl: 'https://api.sunoapi.org/sample2.mp3',
          metadata: {
            title: 'Test Energetic Track',
            duration: 195,
            genre: 'electronic',
            mood: 'energetic'
          }
        };
        this.processWebhookEvent(testEvent2);
      }
    }, 8000);
  }

  public destroy(): void {
    this.handlers.clear();
    this.pendingTracks.clear();
    console.log('üîó Webhook service destroyed');
  }
}

const webhookService = new WebhookService();
export default webhookService;
